	"grid-template-rows":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/grid-template-rows","nfo":"The grid-template-rows CSS property defines the line names and track sizing functions of the grid's rows."},
	"height":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/height","nfo":"The height CSS property specifies the height of the content area of an element. The content area is inside the padding, border, and margin of the element."},
	"height (@viewport)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@viewport/height","nfo":"The height CSS descriptor is a shorthand descriptor for setting both min-height and max-height of the viewport. by providing one viewport length value will set both, the minimum height and the maximum height, to the value provided."},
	// ":hover":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:hover","nfo":"The :hover CSS pseudo-class matches when the user designates an element with a pointing device, but does not necessarily activate it. This style may be overridden by any other link-related pseudo-classes, that is :link, :visited, and :active, appearing in subsequent rules. In order to style appropriately links, you need to put the :hover rule after the :link and :visited rules but before the :active one, as defined by the LVHA-order: :link — :visited — :hover — :active."},
	"hsl()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/color_value#hsl()","nfo":"The <color> CSS data type denotes a color in the sRGB color space. A color can be described in any of these ways:"},
	"hsla()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/color_value#hsla()","nfo":"The <color> CSS data type denotes a color in the sRGB color space. A color can be described in any of these ways:"},
	"hue-rotate()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/filter#hue-rotate()","nfo":"The filter property provides graphical effects like blurring, sharpening, or color shifting an element. Filters are commonly used to adjust the rendering of images, backgrounds, and borders."},
	"hyphens":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/hyphens","nfo":"The hyphens CSS property tells the browser how to hyphenate words when line-wrapping. You can prevent hyphenation entirely, control when the browser should hyphenate, or let the browser control when to hyphenate."},
	"hz":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/frequency#hz","nfo":"The <frequency> CSS data type denotes a frequency dimension, like the pitch of a speaking voice. It consists of a <number> immediately followed by the unit. Like for any CSS dimension, there is no space between the unit literal and the number."},
	"<image>":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/image","nfo":"The <image> CSS data type represents a 2D image. There are two kinds of images in CSS: plain static images, often referenced using a URL, and dynamically-generated images like gradients or representations of parts of the tree."},
	"image()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/image#The_image()_functional_notation","nfo":"The <image> CSS data type represents a 2D image. There are two kinds of images in CSS: plain static images, often referenced using a URL, and dynamically-generated images like gradients or representations of parts of the tree."},
	"image-orientation":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/image-orientation","nfo":"The image-orientation CSS property describes how to correct the default orientation of an image."},
	"image-rendering":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/image-rendering","nfo":"The image-rendering CSS property provides a hint to the browser about the algorithm it should use to scale images. It applies to the element itself as well as any images supplied in other properties for the element. It has no effect on non-scaled images."},
