	"@import":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@import","nfo":"The @import CSS at-rule is used to import style rules from other style sheets. These rules must precede all other types of rules, except @charset rules; as it is not a nested statement, @import cannot be used inside conditional group at-rules."},
