	// ":indeterminate":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:indeterminate","nfo":"The :indeterminate CSS pseudo-class represents:"},
	"inherit":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/inherit","nfo":"The inherit CSS-value causes the element for which it is specified to take the computed value of the property from its parent element. It is allowed on every CSS property."},
	"initial":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/initial","nfo":""},
	"inline-size":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/inline-size","nfo":"The inline-size CSS property defines the horizontal or vertical size of an element's block depending on its writing mode. It corresponds to the width or the height property depending on the value defined for writing-mode."},
	"inset()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/inset","nfo":""},
	"<integer>":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/integer","nfo":"The <integer> CSS data type denotes an integer number, positive or negative. There isn't any associated unit with the value. An integer consists of one or several decimal digits, 0 to 9, optionally preceded by one single + or - sign."},
	// ":invalid":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:invalid","nfo":"The :invalid CSS pseudo-class represents any <input> or <form> element whose content fails to validate according to the input's type setting. This allows you to easily have invalid fields adopt an appearance that helps the user identify and correct errors."},
	"invert()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/filter#invert()","nfo":"The filter property provides graphical effects like blurring, sharpening, or color shifting an element. Filters are commonly used to adjust the rendering of images, backgrounds, and borders."},
	"isolation":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/isolation","nfo":"The isolation CSS property defines if the element must create a new stacking context."},
	"justify-content":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/justify-content","nfo":"The CSS justify-content property defines how the browser distributes space between and around flex items along the main-axis of their container."},
	"@keyframes":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@keyframes","nfo":"The @keyframes CSS at-rule lets authors control the intermediate steps in a CSS animation sequence by establishing keyframes (or waypoints) along the animation sequence that must be reached by certain points during the animation. This gives you more specific control over the intermediate steps of the animation sequence than you'd get when letting the browser handle everything automatically."},
	"khz":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/frequency#khz","nfo":"The <frequency> CSS data type denotes a frequency dimension, like the pitch of a speaking voice. It consists of a <number> immediately followed by the unit. Like for any CSS dimension, there is no space between the unit literal and the number."},
	// ":lang":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:lang","nfo":"The :lang CSS pseudo-class matches elements based on the language the element is determined to be in. In HTML, the language is determined by a combination of the lang attribute, the <meta> element, and possibly by information from the protocol (such as HTTP headers). For other document types there may be other document methods for determining the language."},
	// ":last-child":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:last-child","nfo":"The :last-child CSS pseudo-class represents any element that is the last child element of its parent."},
	// ":last-of-type":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:last-of-type","nfo":"The :last-of-type CSS pseudo-class represents the last sibling with the given element name in the list of children of its parent element."},
	// ":left":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:left","nfo":"The :left CSS page pseudo-class matches any left page when printing a page. It allows to describe the styling of left-side pages."},
