	"perspective":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/perspective","nfo":"The perspective CSS property determines the distance between the z=0 plane and the user in order to give to the 3D-positioned element some perspective. Each 3D element with z>0 becomes larger; each 3D-element with z<0 becomes smaller. The strength of the effect is determined by the value of this property."},
