	"perspective-origin":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/perspective-origin","nfo":"The perspective-origin CSS property determines the position the viewer is looking at. It is used as the vanishing point by the perspective property."},
	"pointer-events":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/pointer-events","nfo":"The CSS property pointer-events allows authors to control under what circumstances (if any) a particular graphic element can become the target of mouse events. When this property is unspecified, the same characteristics of the visiblePainted value apply to SVG content."},
	"polygon()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/polygon","nfo":""},
