	"prefix (@counter-style)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@counter-style/prefix","nfo":"The prefix descriptor of the @counter-style rule allows authors to specify a symbol that will be prepended to the marker representation. If no value is specified, the default value will be the empty string."},
