	"rad":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/angle#rad","nfo":"The <angle> CSS data type represents angle values. Positive angles represent clockwise angles, negative angles represent counterclockwise angles. Its syntax is a <number> data type immediately followed by the unit (deg, grad, rad or turn). Like for any CSS dimension, there is no space between the unit literal and the number."},
	"radial-gradient()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/radial-gradient","nfo":""},
	"range (@counter-style)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@counter-style/range","nfo":"When defining custom counter styles, the range descriptor lets the author specify a range of counter values over which the style is applied. If a counter value is outside the specified range, then the fallback style will be used to construct the representation of that marker. Value of the range descriptor can be either auto or a comma separated list of lower and upper bounds specified as integers."},
