	"resize":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/resize","nfo":"The resize CSS property lets you control the resizability of an element."},
	"<resolution>":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/resolution","nfo":"The <resolution> CSS data types, used in media queries, denotes the density of pixels of an output device, its resolution. It is a <number> immediately followed by a unit of resolution (dpi, dpcm, ...). Like for any CSS dimension, there is no space between the unit literal and the number."},
