	"ruby-position":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/ruby-position","nfo":"The ruby-position CSS property defines the position of a ruby element relatives to its base element. It can be position over the element (over), under it (under), or between the characters, on their right side (inter-character)."},
	"s":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/time#s","nfo":"The <time> CSS data type denotes time dimensions expressed in seconds or milliseconds. They consists of a​ ​​​​​​<number> immediately followed by the unit. Like for any CSS dimension, there is no space between the unit literal and the number."},
	"saturate()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/filter#saturate()","nfo":"The filter property provides graphical effects like blurring, sharpening, or color shifting an element. Filters are commonly used to adjust the rendering of images, backgrounds, and borders."},
	"scale()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/transform-function#scale()","nfo":""},
