	// ":scope":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:scope","nfo":"The :scope CSS  pseudo-class matches the elements that are a reference point for selectors to match against. In HTML, a new reference point can be defined using the scoped attribute of the <style>. If no such attribute is used on an HTML page, the reference point is the <html> element."},
	"scroll-behavior":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/scroll-behavior","nfo":"The scroll-behavior CSS property specifies the scrolling behavior for a scrolling box, when scrolling happens due to navigation or CSSOM scrolling APIs. Any other scrolls, e.g. those that are performed by the user, are not affected by this property. When this property is specified on the root element, it applies to the viewport instead."},
	"scroll-snap-coordinate":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/scroll-snap-coordinate","nfo":"The scroll-snap-coordinate CSS property defines the positions in x and y coordinates within the element which will align with the nearest ancestor scroll container's scroll-snap-destination for the respective axis."},
	"scroll-snap-destination":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/scroll-snap-destination","nfo":"The scroll-snap-destination CSS property defines the position in x and y coordinates within the scroll container's visual viewport which element snap points align with."},
	"scroll-snap-type":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/scroll-snap-type","nfo":"The scroll-snap-type CSS property defines how strictly snap points are enforced on the scroll container in case there is one."},
	// "::selection":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/::selection","nfo":"The ::selection CSS pseudo-element applies rules to the portion of a document that has been highlighted (e.g. selected with the mouse or another pointing device) by the user."},
	"sepia()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/filter#sepia()","nfo":"The filter property provides graphical effects like blurring, sharpening, or color shifting an element. Filters are commonly used to adjust the rendering of images, backgrounds, and borders."},
	"<shape>":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/shape","nfo":"The <shape> CSS data type denotes the specific form of a region. This region is used to define on which part of an element some properties like clip do apply."},
	"shape-image-threshold":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/shape-image-threshold","nfo":"The shape-image-threshold CSS property defines the alpha channel threshold used to extract the shape using an image as the value for shape-outside. A value of 0.5 means that the shape will enclose all the pixels that are more than 50% opaque."},
	"shape-margin":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/shape-margin","nfo":"The shape-margin CSS property adds a margin to shape-outside."},
	"shape-outside":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/shape-outside","nfo":"The shape-outside CSS property uses shape values to define the float area for a float and will cause inline content to wrap around the shape instead of the float's bounding box."},
	"skew()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/transform-function#skew()","nfo":""},
