	"speak-as (@counter-style)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@counter-style/speak-as","nfo":"The speak-as descriptor specifies how a counter symbol constructed with a given @counter-style will be represented in the spoken form. For example, an author can specify a counter symbol to be either spoken as its numerical value or just represent it with an audio cue."},
	"src (@font-face)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@font-face/src","nfo":""},
