	"unset":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/unset","nfo":""},
	"<url>":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/url","nfo":"The <url> CSS data type denotes a pointer to a resource. It has no proper syntax and can only be expressed through the url() functional notation."},
	"url()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/url#The_url()_functional_notation","nfo":"The <url> CSS data type denotes a pointer to a resource. It has no proper syntax and can only be expressed through the url() functional notation."},
	"user-zoom (@viewport)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@viewport/user-zoom","nfo":"The user-zoom CSS descriptor controls whether or not the user should be able to change the zoom factor of a document defined by @viewport."},
	// ":valid":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:valid","nfo":"The :valid CSS pseudo-class represents any <input> or <form> element whose content validates correctly according to the input's type setting. This allows to easily make valid fields adopt an appearance that helps the user confirm that their data is formatted properly."},
	"var()":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/var","nfo":"The var() function can be used instead of any part of a value in any property on an element. The var() function can not be used as property names, selectors or anything else besides property values. (Doing so usually produces invalid syntax or else a value whose meaning has no connection to the variable.)"},
	"vertical-align":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/vertical-align","nfo":"The vertical-align CSS property specifies the vertical alignment of an inline or table-cell box."},
	"vh":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/length#vh","nfo":""},
	"@viewport":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@viewport","nfo":"The @viewport CSS at-rule contains a set of nested descriptors in a CSS block that is delimited by curly braces. These descriptors control viewport settings, primarily on mobile devices."},
	"visibility":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/visibility","nfo":"The visibility property can be used to hide an element while leaving the space where it would have been. It can also hide rows or columns of a table."},
	// ":visited":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/:visited","nfo":"The :visited CSS pseudo-class lets you select only links that have been visited. This style may be overridden by any other link-related pseudo-classes, that is :link, :hover, and :active, appearing in subsequent rules. In order to style appropriately links, you need to put the :visited rule after the :link rule but before the other ones, defined in the LVHA-order: :link — :visited — :hover — :active."},
	"vmax":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/length#vmax","nfo":""},
	"vmin":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/length#vmin","nfo":""},
	"vw":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/length#vw","nfo":""},
	"white-space":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/white-space","nfo":"The white-space property is used to describe how whitespace inside the element is handled."},
	"widows":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/widows","nfo":"When a paragraph is split over two pages in paged media, the widows CSS property defines the minimum number of lines that must be left at the top of the second page. In typography, a widow is the last line of a paragraph appearing alone at the top of a new page. Setting the widows property allows the prevention of single-line widows."},
	"width":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/width","nfo":"The width CSS property specifies the width of the content area of an element. The content area is inside the padding, border, and margin of the element."},
	"width (@viewport)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@viewport/width","nfo":"The width CSS descriptor is shorthand for setting both the min-width and the max-width of the viewport. By providing one viewport length value, that value will determine both the min-width and the max-width to the value provided."},
	"will-change":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/will-change","nfo":"The will-change CSS property provides a way for authors to hint browsers about the kind of changes to be expected on an element, so that the browser can set up appropriate optimizations ahead of time before the element is actually changed. These kind of optimizations can increase the responsiveness of a page by doing potentially expensive work ahead of time before they are actually required."},
	"word-break":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/word-break","nfo":"The word-break CSS property is used to specify whether to break lines within words."},
	"word-spacing":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/word-spacing","nfo":"The word-spacing CSS property specifies the spacing behavior between tags and words."},
	"word-wrap":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/word-wrap","nfo":"The overflow-wrap property is used to specify whether or not the browser may break lines within words in order to prevent overflow when an otherwise unbreakable string is too long to fit in its containing box."},
	"writing-mode":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/writing-mode","nfo":"The writing-mode property defines whether lines of text are laid out horizontally or vertically and the direction in which blocks progress."},
	"z-index":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/z-index","nfo":"The z-index property specifies the z-order of an element and its descendants. When elements overlap, z-order determines which one covers the other. An element with a larger z-index generally covers an element with a lower one."},
	"zoom (@viewport)":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/@viewport/zoom","nfo":"The zoom CSS Descriptor sets the initial zoom factor of a document defined by @viewport."},
	"--*":{"url":"https://developer.mozilla.org/en-US/docs/Web/CSS/--*","nfo":""}
